  false,\n\t\"url\": null,\n\t\"notes\": \"Carson Sink is a low basin and drainage
  sump in a desert valley of west-central Nevada. It embraces parts of 14 townships
  but the unit here considered falls within a twelve mile square. The shores are sage
  brush desert and sand dunes. There are two main inlets but no outlet. The water
  is only medium alkaline. There is a variety and great abundance of natural duck
  foods and plenty of cover for protection of nesting waterfowl. Ducks, geese, shore
  birds, and varied waterfowl in great numbers use the Carson Sink area, Muskrats
  are numerous and fur-farming is a possibility. Frogs and clams are common and snails
  and aquatic insect life abundant. It has a great value as a potential bird refuge.\",\n\t\"license_title\":
